import * as React from 'react';
import { styled } from '@mui/material/styles';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import CardProyect from '../../components/cardProyects/CardProyect.js';
import image1 from '../../static/images/cards/portfolio.jpg';
import image2 from '../../static/images/cards/portfolio.jpg';
import image3 from '../../static/images/cards/portfolio.jpg';

const Item = styled(Box)(({ theme }) => ({
  backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: 'center',
  color: theme.palette.text.secondary,
}));

export default function Gallery() {
  return (
    <Box sx={{ width: '100%' }}>
      <Grid container rowSpacing={2} columnSpacing={{ xs: 1, sm: 2, md: 3 }}>
        <Grid item xs={12} sm={6} md={4}>
          <Item>
            <CardProyect image={image1} />
          </Item>
        </Grid>
        <Grid item xs={12} sm={6} md={4}>
          <Item>
            <CardProyect image={image2} />
          </Item>
        </Grid>
        <Grid item xs={12} sm={6} md={4}>
          <Item>
            <CardProyect image={image3} />
          </Item>
        </Grid>
      </Grid>
    </Box>
  );
}
